import React from "react"
import ReactDom from "react-dom"

function UnList(){
    return (
    <ul>
        <li>Apple</li>
        <li>Mango</li>
        <li>PineApple</li>
     </ul>
    )
}

ReactDom.render(<UnList/>,document.getElementById('root'));
